Job_Description:
@HYVE Solutions, missions to help customers, business partners, and employees achieve success through shared goals, strategies, resources and technology solutions.

Network Engineer: Operates company's internal data communications systems. Plans, designs and implements local and wide-area network solutions between multiple platforms and protocols (including IP and VOIP). Supports/troubleshoots network issues and coordinates with vendors for installation of such items as routers and switches. Works on project implementation. Provides training and assists with proposal writing. Conducts project planning, cost analysis and vendor comparisons. Survey Tip: Employees whose primary responsibility is focused on the design and application of external communications such as Internet network systems should be matched to Web Developer (6531-6536). May be internal or external, client-focused, working in conjunction with Professional Services and Outsourcing functions. May include company-wide, web-enabled solutions. Employees focused on ensuring products (including websites) and hosted networks are designed and developed to be cyber-safe and compliant are typically matched to one of our software development engineering roles. For cloud databases, may be matched to Storage Engineer (6611-6616) or for hosted networks, to Network Engineer (6471-6476) or Network Systems Administrator (6421-6426). Employees focused on administering and hardening internal processes and systems against outside penetration and attack, match to Information Security Analyst (6581-6586).

, we believe employees are our greatest asset and we empower them to make a difference in our business. Diversity and inclusion make us all better. Qualified applicants will receive consideration for employment without regard to race, color, religion, sex, national origin, sexual orientation, gender identity, disability or protected veteran status.

